import React from 'react'
import './Order.css'

const order = (props) => {
    console.log(props)
    return(
        <div className="order">
            <h3>{props.order.customer_name}</h3>
            <p>{props.customer_email}</p>
            <p>{props.product} : {props.quantity} Qty</p>
        </div>
    )
}

export default order
